import React from 'react'

const BoxSisu = (props) => {
    const style = {
        backgroundColor: props.on ? "red" : "green"
    }


    return (
        <div
            style={style}
            onClick={() => props.vajuta(props.id)}
        >
            {props.id}
        </div>
    );
}

export default BoxSisu
